import { createApp } from "vue";
import App from "./App.vue";
import {createRouter} from "vue-router";
import Filtered from "@/Filtered";

const router = createRouter({
        
        routes: [{
            path: '/filtered',
            component: Filtered,
        },
        {
            path: '/',
            component: App,
        }],
});

const app = createApp(App);
app.use(router);


app.mount("#app");
